import { formatDate } from '@angular/common';
import { ReporteService } from './../services/reporte.service';
import { Component, OnInit } from '@angular/core';
import { Reporte } from '../interfaces/Reporte';
import { ActivatedRoute } from '@angular/router';
import { AuthService } from '../../users/services/auth.service';
import { FuncionesService } from '../../generales/services/funciones.service';
import { LoadingService } from '../../generales/services/loading.service';


import * as jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { Sucursal } from 'src/app/sucursales/interfaces/sucursal';

@Component({
  selector: 'app-detalle-reporte',
  templateUrl: './detalle-reporte.component.html',
})
export class DetalleReporteComponent implements OnInit {
  reporte: Reporte;
  titulo = 'Reporte NÂº: ';
  // jsPDF: any;
  sucursal: Sucursal = new Sucursal();
  constructor(
    public  reporteService: ReporteService,
    public funcionesService: FuncionesService,
    public authService: AuthService,
    public  activatedRoute: ActivatedRoute,
    public loadingService: LoadingService,
  ) {}

  ngOnInit() {
    this.loadingService.abrirModal();
    this.activatedRoute.paramMap.subscribe((params) => {
      const id = +params.get('id');
      this.reporteService.getReporte(id).subscribe((reporte) => {
        (this.reporte = reporte),  this.loadingService.cerrarModal();
      });
    });
    this.cargarSucursal();
  }

  cargarSucursal() {
    this.sucursal = this.funcionesService.getDatos();
  }

  imprimirReporte() {
    // tslint:disable-next-line: max-line-length
    const img = 'data:image/jpeg;base64,';
    const doc = new jsPDF({
      orientacion: 'l',
      unit: 'pt',
      format: 'carta',
      putOnlyUsedFonts: true,
      floatPrecision: 16
    });
    doc.addImage(img, 'JPEG', 35, 5, 300, 83);
    doc.setFontSize(12);
    const date = formatDate(new Date(), 'dd - MMMM-yyyy', 'es-Cl') ;
    doc.text(`${date}`, 438 , 45 );
    autoTable(doc, {
      html: '#tablaReportes',
      styles: { fillColor: [156, 156, 156] },
      columnStyles: { 0: { halign: 'center' } }, // Cells in first column centered and green
      margin: { top: 75 },
    });
    doc.autoPrint();
    doc.save(` ${date}-informe-Productos.pdf`);
  }



}
